('2308','23','6092','Hotel de la vila',Null,'Sehr gemütliches Dorfhotel Nähe Inca zu verkaufen','32615','Nur wenige Fahrminuten von Inca entfernt liegt dieses sehr gemütlich eingerichtete Dorfhotel mit einer „Hotel interior“ Lizenz. Das Hotel wurde 2011 saniert und bietet im Haupthaus 6 Doppelzimmer mit je einem Badezimmer en suite. Im Nebenhaus hat es noch ein 80m² großes Apartment über 2 Etagen mit Wohn-Esszimmer, Küche (vorinstalliert), WC, 1 Schlafzimmer und ein Badezimmer. Im Innenhof können die Gäste in einem Jacuzzi relaxen. Öffentliche Parkplätze sind vorhanden. Zur Ausstattung gehören eine Fußbodenheizung  Solar / Wasser (warm /kalt), Holz Doppelglasfenster, Parkett und Microcement Böden und eine komplette Möblierung. ','32616','895000','106','2015-03-11 13:57:40','110','2015-03-11 13:58:52',Null,'2349','105','1106',1,'1','0',Null,Null,Null,'32617',Null,'0','0','0',Null,'2015-06-11 16:41:44',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'32618',Null,'32619',Null,'32620',Null,'32621','608904162','32622','0',0,'3');
